import React, { Component } from 'react'
import Img from '../../../assets/images/logo.png'
import './Logo.scss'



export default class Logo extends Component {
    render() {
        return (
            <article className={classes}>
                <img src={Img} alt=""/>
            </article>
        )
    }
}
